import React from "react";
import { Link } from "react-router-dom";

class Home extends React.Component{
    render(){
        return (
			<div className="jumbotron">
				<h1 className="display-3">Bem vindo!</h1>
				<p className="lead">Esse é seu sistema de finanças.</p>
				<p className="lead">Seu saldo para o mês atual é de R$ 5.325,21</p>
				<hr className="my-4" />
				<p>E essa é sua área administrativa, utilize um dos menus ou botões abaixo para navegar pelo sistema.</p>
				<div className="lead d-flex justify-content-center">
					<Link to="/consulta-lancamentos" className="btn btn-primary btn-lg" ><i className="fa fa-users"></i>Cadastrar Usuário</Link>
					<Link to="/consulta-lancamentos" ><a className="btn btn-danger btn-lg" href="https://bootswatch.com/flatly/#" role="button">
						<i className="fa fa-users"></i>
						Cadastrar Lançamento</a></Link>
				</div>
			</div>
        );
    }
}

export default Home;
